export default (function(a,b,c,d,e,f,g,h,i){return {data:{rKFiMWFUHC:{data:{id:870,attributes:{imdbId:"tt0072886",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMmU2NTZlNGQtMWRhNS00ZjQ5LWJiNzktY2U1NzM0MjIzODU1XkEyXkFqcGdeQXVyMjI4MjA5MzA@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"}],item_lang:{data:{id:1533,attributes:{title:"Doc Savage: The Man of Bronze",plot:"In the Fabulous Thirties, Doc Savage and his five Amazing Adventurers are sucked into the mystery of Doc's father disappearing in the wilds of South America. The maniacal Captain Seas tries to thwart them at every turn as they travel to the country of Hidalgo to investigate Doc's father's death and uncover a vast horde of Incan gold.",slug:"doc-savage-the-man-of-bronze"}}},books:{data:[{id:5322,attributes:{title:"Doc Savage",description:"Doc Savage is a physician, surgeon, scientist, adventurer, inventor, explorer, researcher, and musician - a renaissance man. A team of scientists (assembled by his father) trained his mind and body to near-superhuman abilities almost from birth, giving him great strength and endurance, a photographic memory, mastery of the martial arts and vast knowledge of the sciences. Dent described the hero as a mix of Sherlock Holmes' deductive abilities, Tarzan's outstanding physical abilities, Craig Kennedy's scientific education, and Abraham Lincoln's goodness. Lester Dent, a serious man of adventure himself, contributed to the legendary Black Mask Magazine some hard boiled\u002Fnoir crime tales as well. This edition sports a cover by the also legendary Doc Savage cover artist Bob Larkin!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Cv4oGQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Tom Roberts"],firstBook:true,published:"2009-02-01",publisher:"Moonstone Press",subtitle:"The Lost Radio Scripts of Lester Dent"}},{id:5323,attributes:{title:c,description:d,thumbnail:e,authors:[f,b],firstBook:a,published:g,publisher:h,subtitle:i}},{id:5324,attributes:{title:c,description:d,thumbnail:e,authors:[f,b],firstBook:a,published:g,publisher:h,subtitle:i}},{id:5325,attributes:{title:"Fortress of Solitude: A Doc Savage Adventure",description:"\"Fortress of Solitude: A Doc Savage Adventure\" by Lester Bernard Dent. Published by Good Press. Good Press publishes a wide range of titles that encompasses every genre. From well-known classics & literary fiction and non-fiction to forgotten−or yet undiscovered gems−of world literature, we issue the books that need to be read. Each Good Press edition has been meticulously edited and formatted to boost readability for all e-readers and devices. Our goal is to produce eBooks that are user-friendly and accessible to everyone in a high-quality digital format.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=IGJBEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Lester Bernard Dent"],firstBook:a,published:"2021-08-31",publisher:"Good Press",subtitle:""}},{id:5326,attributes:{title:"Bigger Than Life",description:"In this biography, Marilyn Cannaday recreates the life and times of Lester Dent, a little-known giant of the pulp magazine era of U.S. popular literature. From 1929 to 1959, Dent wrote and sold millions of words of fiction—wildly colorful action stories with sea, air and western settings, adventure and suspense novels. His most famous serial character was supehero Doc Savage, the Man of Bronze, who battled crime throughout the pages of a ten-cent pulp magazine in the thirties and forties.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QffyEL5J724C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Marilyn Cannaday"],firstBook:a,published:"1990-01-01",publisher:"Popular Press",subtitle:"The Creator of Doc Savage"}}]}}},meta:{}}},prerenderedAt:1680940957227}}(null,"Lester Dent","The Doc Savage MEGAPACK®","Doc Savage is a fictional character originally published in American pulp magazines during the 1930s and 1940s. He was created by publisher Henry W. Ralston and editor John L. Nanovic at Street & Smith Publications, with additional material contributed by the series' main writer, Lester Dent. The heroic-adventure character would go on to appear in other media, including radio, film, and comic books, with his adventures reprinted for modern-day audiences in a series of paperback books, which have sold more than 20 million copies. Stan Lee (Marvel Comics) has credited Doc Savage as being the forerunner to modern superheroes. This volume collects ten adventures: THE MAN OF BRONZE THE THOUSAND-HEADED MAN METEOR MENACE THE POLAR TREASURE BRAND OF THE WEREWOLF THE LOST OASIS THE MONSTERS THE LAND OF TERROR THE MYSTIC MULLAH THE PHANTOM CITY If you enjoy this ebook, don't forget to search your favorite ebook store for \"Wildside Press Megapack\" to see more of the 350+ volumes in this series, covering adventure, historical fiction, mysteries, westerns, ghost stories, science fiction -- and much, much more!","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fPbHDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","Kenneth Robeson","2019-12-28","Wildside Press LLC","Ten Classic Novels"))